INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118061, "フリーマーケット会場", 1, 40, 10118, "青空の下で謁見", 0, 7, 8, "ペコリーヌとの出会い", 0, 91002, 2, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118062, "フリーマーケット会場", 1, 40, 10118, "未来の騎空団\nマスコット？", 0, 7, 8, "マホとの出会い", 0, 91002, 2, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118063, "ランドソル市街地", 1, 40, 10118, "お嬢さまからの\n緊急依頼", 0, 7, 8, "アキノとの出会い", 0, 91002, 2, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118064, "フリーマーケット会場", 1, 40, 10118, "黄金色の悩みごと", 0, 18, 8, "ジュンとの出会い", 0, 91002, 2, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118065, "フリーマーケット会場", 1, 40, 10118, "白熱！　格闘大会！", 0, 18, 8, "カオリとの出会い", 0, 91002, 2, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118066, "オーエド町", 1, 40, 10118, "祭り太鼓はオーエドの華", 0, 16, 8, "ニノンとの出会い", 1, 91002, 2, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118067, "フリーマーケット会場", 1, 40, 10118, "人気者は遅れて\nやってくる", 0, 19, 8, "スズナとの出会い", 0, 91002, 3, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118068, "ランドソル市街地", 1, 40, 10118, "巫女・ミーツ・魔法少女", 0, 18, 8, "ナナカとの出会い", 0, 91002, 3, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118069, "フリーマーケット会場", 1, 40, 10118, "ネズ耳は二度なくなる", 0, 18, 8, "キャル＆コッコロとの出会い", 0, 91002, 3, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118070, "ランドソル市街地", 1, 40, 10118, "この出会いにカンパイ！", 0, 18, 8, "ユカリとの出会い", 0, 91002, 3, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118071, "ランドソル市街地", 1, 40, 10118, "陰陽アンサンブル", 0, 18, 8, "アオイとの出会い", 0, 91002, 3, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118072, "フリーマーケット会場", 1, 40, 10118, "運試し十番勝負！", 0, 7, 8, "シノブとの出会い", 1, 91002, 3, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (5118600, 0, 0, 0, 10118, "彼女たちの新たな日常", 10145115, 0, 0, "オープニング", 0, 0, 1, 0, 0);
